Style NoteHandcrafted from premium leather, this wallet from jag is specially designed and created with the highest quality standards, ensuring that this piece will last for several years. Its classic styling and minimalistic detailing offers unbeatable understated style, while multiple pockets and slots help keep your monetary essentials organised.nbsp;
Product DetailsBlack leather wallet with green and red top stitch detailEmbossed branding on the frontTwo main compartmentsOne card slot, one photo id card slot and a slip pocket on the leftnbsp;
nbsp;
Three card slots and a slip pocket on the rightGuarantee: 1yr Materials and CareLeatherWipe with damp cloth to remove dust SizeDimensions: 11cm x 9.5 cmWarranty provided by the brand owner / manufacturer
